// GettingStarted.js
import React from 'react';
import styles from './GettingStarted.module.css';
import { FaPlayCircle } from 'react-icons/fa';

const videos = [
  {
    id: 1,
    title: 'Smartphone Basics',
    description: 'Learn the essentials of using a smartphone effectively.',
    thumbnail: 'thumbnail1.jpg', // Example thumbnail image URL
    creator: 'Creators Box',
    creatorImg: 'creator1.jpg',  // Example creator image URL
  },
  {
    id: 2,
    title: 'Computer Basics',
    description: 'Introduction to using computers for everyday tasks.',
    thumbnail: 'thumbnail2.jpg',
    creator: 'Creators Box',
    creatorImg: 'creator2.jpg',
  },
  // Add more video objects as needed
];

const GettingStarted = () => (
  <div className={styles.container}>
    <h1 className={styles.heading}>Getting Started Videos</h1>
    {videos.map((video) => (
      <div className={styles.videoItem} key={video.id}>
        <div className={styles.thumbnail}>
          <img src={video.thumbnail} alt={`${video.title} thumbnail`} />
          <FaPlayCircle className={styles.playButton} />
        </div>
        <div className={styles.videoDetails}>
          <h2 className={styles.videoTitle}>{video.title}</h2>
          <p className={styles.videoDescription}>{video.description}</p>
          <div className={styles.creator}>
            <img src={video.creatorImg} alt={`${video.creator} profile`} />
            <span>{video.creator}</span>
          </div>
        </div>
      </div>
    ))}
  </div>
);

export default GettingStarted;
